import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Events(){
    const eventName = ['abc', 'cba']
    const navigate = useNavigate();

    const handleLogout = () => {
        navigate('/')
    }

    return(
        <div style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '100vh'}}>
            <div style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '50%', width: '40%', backgroundColor: 'white', color: 'black'}}>
                <h1>Events List</h1>
                <hr />
                <div>
                    {eventName.map((name, index) => (
                        <p key={index} onClick={e => navigate('/eventdetail', {state: {id: index}})}>{name}</p>
                    ))}
                </div>
                <div>
                    <button onClick={handleLogout}>Logout</button>
                </div>
            </div>
        </div>
    );
}
